import { theme } from '@helsenorge/designsystem-react';
export const isIconTypeDestructive = svgIcon => {
  return svgIcon.props.variant === 'error';
};
export const getIconColor = svgIcon => {
  const isDestructive = isIconTypeDestructive(svgIcon);
  return isDestructive ? theme.palette.cherry600 : theme.palette.blueberry700;
};
